ar Navigator Flap' translated)				ifNotNilDo: [:t2 | t1 sugarNavTab: t2]]! !!Flaps class methodsFor: '*SqueakBot2'!newSqueakBotFlapFromQuads: t1 positioning: t2 withPreviousEntries: t3 	| t4 t5 t6 t7 |	t7 := Preferences sugarNavigator.	t5 := PartsBin				newPartsBinWithOrientation: #leftToRight				andColor: Color gray muchLighter				from: t1				withPreviousEntries: t3.	t4 := (t7				ifTrue: [SolidSugarSuppliesTab]				ifFalse: [FlapTab]) new referent: t5 beSticky.	t4		setName: 'SqueakBot' translated		edge: (t7				ifTrue: [#top]				ifFalse: [#bottom])		color: Color red lighter.	t4 position: 0 @ ActiveWorld sugarAllowance.	t4 setBalloonText: t4 balloonTextForFlapsMenu.	t4 applyThickness: 20.	t6 := ActiveWorld width.	t5 extent: ActiveWorld width @ (76 * (1 + (1350 // t6))).	t5 beFlap: true.	t5 autoLineLayout: true.	t7		ifTrue: [t4 useSolidTab.			t4 height: 20;								color: (Color						r: 0.804						g: 0.804						b: 0.804)]		ifFalse: [t4 color: Color red lighter].	^ t4! !!Flaps class methodsFor: '*SqueakBot2'!quadsDefiningSqueakBotFlap	^ self registeredFlapsQuadsAt: 'SqueakBot'! !!ProjectNavigationMorph methodsFor: '*SqueakBot2'!buttonSqueakBot	^ self		makeButton: 'SqueakBot' translated		balloonText: 'The robotic panel' translated		for: #toggleSqueakBot! !!SqueakBot class methodsFor: 'as yet unclassified'!initialize	SugarLibrary default iconAt: 'toggleSqueakBot' put: SqueakBotBitmapLibrary squeakBotIcon.	SugarNavigatorBar refreshButRetainOldContents.	Flaps initializeSqueakBotFlap! !!SqueakBotBitmapLibrary class methodsFor: 'as yet unclassified'!arduinoIcon	^ Form		extent: 60 @ 42		depth: 32		bits: (Base64MimeConverter mimeDecodeToBytes: '6dgVAAsKCGmH8whqiCr/CGuJD/8Uco7/MoOb/w1tiwr/B2uJF/8KaYX/El10/xJedv8SXXT/
